import React from 'react';
import { HomeBody, ActionContainer, HeaderContainer, AboutContainer } from './styles';


const Home = () => {
  return (
    <HomeBody>
     <ActionContainer> 
         <div>Sign Up</div>
        <div>Login</div>
     </ActionContainer>

     <AboutContainer>
       <div className="about-wrapper">
       <img src="https://picsum.photos/600" className="about" alt="about"/>
       </div>
       <div className="about-us">
         <div className="title">About Us</div>
         <div className="content">Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever s</div>
       </div>
     </AboutContainer>
    </HomeBody>
  );
}

export default Home;
